import React, { lazy, Suspense } from "react";
const NavBar = "../Reusable Components/Navbar";
const About = "./About";
const BlogLatest = "./BlogLatest";
const Slides = "./Slides";
const Footer = "../Reusable Components/Footer";
const ScrollToTop = "../Reusable Components/ScrollToTop";

const Homepage = () => {
	return (
		<div className="homepage">
			<NavBar />
			<Slides />
			<About />
			<BlogLatest />
			<Footer />
			<ScrollToTop />
		</div>
	);
};

export default Homepage;
